import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";
import HomePage from "./HomePage";
import FeedPage from "./FeedPage";
import FullScreen from "./FullScreen";
import FullView from "./FullView";
import Routes2016 from "./assets/images/feed/routes2016";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          <Route exact path="/">
            <HomePage />
          </Route>
          <Route exact path="/feed">
            <FeedPage />
          </Route>
          <Route exact path="/feed/fullScreen">
            <FullScreen />
          </Route>
          <Route path="/feed/fullView" component={FullView}>
            {/* <Route path="/feed/fullView/:startID" component={FullView}> */}
            {/* <FullView  /> */}
          </Route>
          {Routes2016()}
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
